export class Produto {

  id: number = 0;
  descricao: string = '';
  precoDeCompra: number = 0;
  precoDeVenda: number = 0;
  lucroLiquido : number = 0;
  quantidade: number = 0;
  codigo: number = 0;
  dataDeCriacao: string = '';

}
